class Solution {
    fun minimumBeautifulSubstrings(s: String): Int {
        val powersOfFive = mutableListOf<Long>()
        var current: Long = 1
        while (current <= (1L shl s.length) - 1) {
            powersOfFive.add(current)
            current *= 5
        }

        val dp = IntArray(s.length + 1) { Int.MAX_VALUE }
        dp[0] = 0
        for (i in 1..s.length) {
            if (s[i - 1] == '0') continue
            var num = 0L
            for (j in i downTo 1) {
                num = num shl 1 or (s[j - 1] - '0').toLong()
                if (powersOfFive.contains(num)) {
                    dp[i] = kotlin.math.min(dp[i], dp[j - 1] + 1)
                }
            }
        }
        return if (dp[s.length] == Int.MAX_VALUE) -1 else dp[s.length]
    }
}
